CREATE DEFINER=`root`@`localhost` PROCEDURE `ReactivarEmpleadosVacaciones` ()   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE emp_id INT;
    DECLARE vacacion_id INT;
    
    DECLARE cur CURSOR FOR 
        SELECT ev.ID_EMPLEADO, ev.ID_VACACION
        FROM empleado_vacaciones ev
        WHERE ev.ESTADO = 'ACTIVA' 
        AND ev.FECHA_FIN = CURDATE()
        AND ev.REACTIVACION_AUTOMATICA = 'S';
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    OPEN cur;
    
    read_loop: LOOP
        FETCH cur INTO emp_id, vacacion_id;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        UPDATE empleado 
        SET ACTIVO = 'S', ESTADO = 'A'
        WHERE ID_EMPLEADO = emp_id;
        
        UPDATE empleado_vacaciones 
        SET ESTADO = 'FINALIZADA'
        WHERE ID_VACACION = vacacion_id;
        
    END LOOP;
    
    CLOSE cur;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_aplicar_plantilla_horario` (IN `p_id_plantilla` INT, IN `p_id_empleado` INT, IN `p_fecha_desde` DATE, IN `p_fecha_hasta` DATE, IN `p_aplicado_por` INT)   BEGIN
        DECLARE EXIT HANDLER FOR SQLEXCEPTION
        BEGIN
            ROLLBACK;
            RESIGNAL;
        END;
        
        START TRANSACTION;
        
        -- Registrar aplicación
            ID_PLANTILLA, ID_EMPLEADO, FECHA_VIGENCIA_DESDE, 
            FECHA_VIGENCIA_HASTA, APLICADO_POR
        ) VALUES (
            p_id_plantilla, p_id_empleado, p_fecha_desde, 
            p_fecha_hasta, p_aplicado_por
        );
        
        -- Aplicar horarios de la plantilla
            ID_EMPLEADO, ID_DIA, HORA_ENTRADA, HORA_SALIDA,
            TOLERANCIA, NOMBRE_TURNO, FECHA_VIGENCIA_DESDE,
            FECHA_VIGENCIA_HASTA, ORIGEN, ID_PLANTILLA_ORIGEN
        )
        SELECT 
            p_id_empleado,
            phd.ID_DIA,
            phd.HORA_ENTRADA,
            phd.HORA_SALIDA,
            phd.TOLERANCIA,
            phd.NOMBRE_TURNO,
            p_fecha_desde,
            p_fecha_hasta,
            'PLANTILLA',
            p_id_plantilla
        FROM plantilla_horario_detalle phd
        WHERE phd.ID_PLANTILLA = p_id_plantilla 
        AND phd.ACTIVO = 'S';
        
        COMMIT;
    END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_cleanup_biometric_logs` (IN `days_to_keep` INT)   BEGIN
    DECLARE rows_deleted INT DEFAULT 0;
    
    -- Eliminar logs más antiguos que el número de días especificado
    DELETE FROM biometric_logs 
    WHERE CREATED_AT < DATE_SUB(NOW(), INTERVAL days_to_keep DAY);
    
    -- Obtener número de filas eliminadas
    SET rows_deleted = ROW_COUNT();
    
    -- Retornar resultado
    SELECT CONCAT('Se eliminaron ', rows_deleted, ' registros de logs biométricos') as resultado;
END$$

