--
-- Estructura para la vista `vw_biometric_usage_stats`
--
DROP TABLE IF EXISTS `vw_biometric_usage_stats`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_biometric_usage_stats`  AS SELECT `bl`.`VERIFICATION_METHOD` AS `VERIFICATION_METHOD`, `bl`.`OPERATION_TYPE` AS `OPERATION_TYPE`, cast(`bl`.`FECHA` as date) AS `FECHA`, count(0) AS `TOTAL_INTENTOS`, sum(`bl`.`VERIFICATION_SUCCESS`) AS `INTENTOS_EXITOSOS`, round(avg(`bl`.`CONFIDENCE_SCORE`),4) AS `CONFIDENCE_PROMEDIO`, round(sum(`bl`.`VERIFICATION_SUCCESS`) * 100.0 / count(0),2) AS `TASA_EXITO` FROM `biometric_logs` AS `bl` WHERE `bl`.`FECHA` >= curdate() - interval 30 day GROUP BY `bl`.`VERIFICATION_METHOD`, `bl`.`OPERATION_TYPE`, cast(`bl`.`FECHA` as date) ORDER BY cast(`bl`.`FECHA` as date) DESC, `bl`.`VERIFICATION_METHOD` ASC ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_empleados_activos`
--
DROP TABLE IF EXISTS `vw_empleados_activos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_empleados_activos`  AS SELECT `empleado`.`ID_EMPLEADO` AS `ID_EMPLEADO`, `empleado`.`NOMBRE` AS `NOMBRE`, `empleado`.`APELLIDO` AS `APELLIDO`, `empleado`.`ACTIVO` AS `ACTIVO` FROM `empleado` WHERE `empleado`.`ACTIVO` = 'S' ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_empleados_biometric_status`
--
DROP TABLE IF EXISTS `vw_empleados_biometric_status`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_empleados_biometric_status`  AS SELECT `e`.`ID_EMPLEADO` AS `ID_EMPLEADO`, `e`.`NOMBRE` AS `NOMBRE`, `e`.`APELLIDO` AS `APELLIDO`, `e`.`DNI` AS `DNI`, count(case when `bd`.`BIOMETRIC_TYPE` = 'fingerprint' and `bd`.`ACTIVO` = 1 then 1 end) AS `HUELLAS_REGISTRADAS`, count(case when `bd`.`BIOMETRIC_TYPE` = 'facial' and `bd`.`ACTIVO` = 1 then 1 end) AS `FACIAL_REGISTRADO`, CASE WHEN count(case when `bd`.`BIOMETRIC_TYPE` = 'fingerprint' AND `bd`.`ACTIVO` = 1 then 1 end) > 0 AND count(case when `bd`.`BIOMETRIC_TYPE` = 'facial' AND `bd`.`ACTIVO` = 1 then 1 end) > 0 THEN 'COMPLETO' WHEN count(case when `bd`.`BIOMETRIC_TYPE` = 'fingerprint' AND `bd`.`ACTIVO` = 1 then 1 end) > 0 OR count(case when `bd`.`BIOMETRIC_TYPE` = 'facial' AND `bd`.`ACTIVO` = 1 then 1 end) > 0 THEN 'PARCIAL' ELSE 'PENDIENTE' END AS `ESTADO_ENROLAMIENTO`, max(`bd`.`CREATED_AT`) AS `ULTIMO_ENROLAMIENTO` FROM (`empleado` `e` left join `biometric_data` `bd` on(`e`.`ID_EMPLEADO` = `bd`.`ID_EMPLEADO`)) WHERE `e`.`ESTADO` = 'A' AND `e`.`ACTIVO` = 'S' GROUP BY `e`.`ID_EMPLEADO`, `e`.`NOMBRE`, `e`.`APELLIDO`, `e`.`DNI` ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_empleados_en_vacaciones`
--
DROP TABLE IF EXISTS `vw_empleados_en_vacaciones`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_empleados_en_vacaciones`  AS SELECT `e`.`ID_EMPLEADO` AS `ID_EMPLEADO`, `e`.`NOMBRE` AS `NOMBRE`, `e`.`APELLIDO` AS `APELLIDO`, `e`.`DNI` AS `DNI`, `ev`.`ID_VACACION` AS `ID_VACACION`, `ev`.`FECHA_INICIO` AS `FECHA_INICIO`, `ev`.`FECHA_FIN` AS `FECHA_FIN`, `ev`.`MOTIVO` AS `MOTIVO`, `ev`.`OBSERVACIONES` AS `OBSERVACIONES`, to_days(`ev`.`FECHA_FIN`) - to_days(curdate()) AS `DIAS_RESTANTES` FROM (`empleado` `e` join `empleado_vacaciones` `ev` on(`e`.`ID_EMPLEADO` = `ev`.`ID_EMPLEADO`)) WHERE `ev`.`ESTADO` = 'ACTIVA' AND curdate() between `ev`.`FECHA_INICIO` and `ev`.`FECHA_FIN` AND `e`.`ACTIVO` = 'S' ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_empleados_vacaciones_activas`
--
DROP TABLE IF EXISTS `vw_empleados_vacaciones_activas`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_empleados_vacaciones_activas`  AS SELECT `ev`.`ID_VACACION` AS `ID_VACACION`, `ev`.`ID_EMPLEADO` AS `ID_EMPLEADO`, `e`.`NOMBRE` AS `EMPLEADO_NOMBRE`, `e`.`APELLIDO` AS `EMPLEADO_APELLIDO`, `ev`.`FECHA_INICIO` AS `FECHA_INICIO`, `ev`.`FECHA_FIN` AS `FECHA_FIN`, `ev`.`MOTIVO` AS `MOTIVO`, `ev`.`ESTADO` AS `ESTADO`, to_days(`ev`.`FECHA_FIN`) - to_days(`ev`.`FECHA_INICIO`) + 1 AS `DIAS_VACACION`, CASE WHEN curdate() < `ev`.`FECHA_INICIO` THEN 'FUTURO' WHEN curdate() between `ev`.`FECHA_INICIO` and `ev`.`FECHA_FIN` THEN 'ACTIVO' WHEN curdate() > `ev`.`FECHA_FIN` THEN 'FINALIZADO' END AS `ESTADO_ACTUAL` FROM (`empleado_vacaciones` `ev` join `empleado` `e` on(`ev`.`ID_EMPLEADO` = `e`.`ID_EMPLEADO`)) WHERE `ev`.`ESTADO` in ('PROGRAMADO','ACTIVO') ;

-- --------------------------------------------------------

--
-- Estructura para la vista `vw_horarios_vigentes`
--
DROP TABLE IF EXISTS `vw_horarios_vigentes`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_horarios_vigentes`  AS SELECT `ehp`.`ID_EMPLEADO` AS `ID_EMPLEADO`, `ehp`.`ID_DIA` AS `ID_DIA`, `ds`.`NOMBRE` AS `DIA_NOMBRE`, `ehp`.`HORA_ENTRADA` AS `HORA_ENTRADA`, `ehp`.`HORA_SALIDA` AS `HORA_SALIDA`, `ehp`.`TOLERANCIA` AS `TOLERANCIA`, `ehp`.`NOMBRE_TURNO` AS `NOMBRE_TURNO`, `ehp`.`FECHA_VIGENCIA_DESDE` AS `FECHA_VIGENCIA_DESDE`, `ehp`.`FECHA_VIGENCIA_HASTA` AS `FECHA_VIGENCIA_HASTA`, `ehp`.`ORIGEN` AS `ORIGEN`, `ehp`.`ID_PLANTILLA_ORIGEN` AS `ID_PLANTILLA_ORIGEN`, `ph`.`NOMBRE` AS `PLANTILLA_NOMBRE`, `e`.`NOMBRE` AS `EMPLEADO_NOMBRE`, `e`.`APELLIDO` AS `EMPLEADO_APELLIDO` FROM (((`empleado_horario_personalizado` `ehp` join `dia_semana` `ds` on(`ehp`.`ID_DIA` = `ds`.`ID_DIA`)) join `empleado` `e` on(`ehp`.`ID_EMPLEADO` = `e`.`ID_EMPLEADO`)) left join `plantilla_horarios` `ph` on(`ehp`.`ID_PLANTILLA_ORIGEN` = `ph`.`ID_PLANTILLA`)) WHERE `ehp`.`ACTIVO` = 'S' AND (`ehp`.`FECHA_VIGENCIA_DESDE` is null OR `ehp`.`FECHA_VIGENCIA_DESDE` <= curdate()) AND (`ehp`.`FECHA_VIGENCIA_HASTA` is null OR `ehp`.`FECHA_VIGENCIA_HASTA` >= curdate()) ;

